import RegistrationPage from './registrationPage.jsx'
import {NavLink} from 'react-router-dom'
import {logIn, signUp} from './../../redux/reducers/registrationReducer';
import {tryLogIn, trySignUp} from './../../DataBase/Users.js'

const RegistrationPageContainer = (props) =>{
  let logInFunc = (username, password) =>{
    let tryy = tryLogIn(username, password)
    if (tryy){
      props.dispatch(logIn(tryy))
    } else{
      return 'Failed'
    }
  }
  let signUpFunc = (username, password, email) =>{
    let attempt = trySignUp(email)
    if (attempt){
      props.dispatch(signUp(attempt))
    } else{
      return 'Failed'
    }
  }
  return(
    <RegistrationPage tryLogIn={logInFunc} trySignUp={signUpFunc} />
  )
}

export default RegistrationPageContainer
